import{_ as a,o as i,c as e,e as h}from"./app-597fe75a.js";const r={},l=h('<h2 id="ゲーム利用規約" tabindex="-1"><a class="header-anchor" href="#ゲーム利用規約" aria-hidden="true">#</a> ゲーム利用規約</h2><p>TikChoco（以下「当サークル」といいます。）が提供するP2P型ゲームサービス（以下「本サービス」といいます。）をご利用いただくにあたり、本利用規約（以下「本規約」といいます。）が適用されます。ユーザーは、本サービスを利用することにより、本規約に同意したものとみなされます。</p><hr><h3 id="第1条-適用" tabindex="-1"><a class="header-anchor" href="#第1条-適用" aria-hidden="true">#</a> 第1条（適用）</h3><ol><li>本規約は、ユーザーと当サークルとの間の本サービスの利用に関わる一切の関係に適用されます。</li><li>当サークルは、本サービスに関し、本規約のほか、利用ルール等を定めることがあります。これらは本規約の一部を構成します。</li></ol><hr><h3 id="第2条-禁止事項" tabindex="-1"><a class="header-anchor" href="#第2条-禁止事項" aria-hidden="true">#</a> 第2条（禁止事項）</h3><p>ユーザーは、本サービスの利用にあたり、以下の行為をしてはなりません。</p><ol><li>リバースエンジニアリング、逆コンパイル、逆アセンブル、解析等、本サービスのソースコードや構造を解明しようとする行為（ただし、第9条で定めるオープンソース化後は、当該ライセンスに従う場合を除く）</li><li>本サービスまたは他ユーザーの端末・ネットワークに過剰な負荷を与える行為、またはそのおそれのある行為</li><li>不正アクセス、クラッキング、セキュリティ侵害行為</li><li>本サービスの不具合や脆弱性を悪用する行為</li><li>当サークルまたは第三者の著作権、商標権、知的財産権を侵害する行為</li><li>他のユーザーに対する嫌がらせ、脅迫、差別、その他迷惑行為</li><li>公序良俗、法令、本規約に違反する行為</li><li>本サービスの運用・利用環境を妨害する行為、またはそのおそれのある行為</li></ol><hr><h3 id="第3条-アップデートと互換性" tabindex="-1"><a class="header-anchor" href="#第3条-アップデートと互換性" aria-hidden="true">#</a> 第3条（アップデートと互換性）</h3><ol><li>当サークルは、必要に応じて本サービスの機能追加・変更・修正を行うことができます。</li><li>当サークルは、本サービスのすべての過去バージョンとの互換性を保証するものではありません。</li><li>ユーザーは、快適かつ安全に利用するため、最新バージョンを利用することに同意します。</li></ol><hr><h3 id="第4条-免責事項" tabindex="-1"><a class="header-anchor" href="#第4条-免責事項" aria-hidden="true">#</a> 第4条（免責事項）</h3><ol><li>当サークルは、本サービスの利用によりユーザーに生じた直接的または間接的損害について、一切の責任を負いません。</li><li>当サークルは、本サービスが常時利用可能であることや、エラー・バグ・障害が存在しないことを保証しません。</li></ol><hr><h3 id="第5条-知的財産権" tabindex="-1"><a class="header-anchor" href="#第5条-知的財産権" aria-hidden="true">#</a> 第5条（知的財産権）</h3><ol><li>本サービスに関する著作権、商標権、その他一切の知的財産権は、当サークルまたは正当な権利者に帰属します。</li><li>ユーザーは、当サークルの許可なく、本サービスの内容を複製、送信、配布、改変、公衆送信等をしてはなりません。</li></ol><hr><h3 id="第6条-利用停止" tabindex="-1"><a class="header-anchor" href="#第6条-利用停止" aria-hidden="true">#</a> 第6条（利用停止）</h3><p>当サークルは、ユーザーが本規約に違反した場合、事前の通知なく利用停止やアクセス制限、その他必要な措置を講じることができます。</p><hr><h3 id="第7条-規約の変更" tabindex="-1"><a class="header-anchor" href="#第7条-規約の変更" aria-hidden="true">#</a> 第7条（規約の変更）</h3><p>当サークルは、必要に応じて本規約を変更できるものとします。変更後の規約は、本サービス上での掲示または通知の時点で効力を生じます。</p><hr><h3 id="第8条-準拠法・管轄裁判所" tabindex="-1"><a class="header-anchor" href="#第8条-準拠法・管轄裁判所" aria-hidden="true">#</a> 第8条（準拠法・管轄裁判所）</h3><p>本規約は日本法に準拠します。本サービスに関して生じた紛争については、日本の東京地方裁判所を第一審の専属的合意管轄裁判所とします。</p><hr><h3 id="第9条-将来的なオープンソース化" tabindex="-1"><a class="header-anchor" href="#第9条-将来的なオープンソース化" aria-hidden="true">#</a> 第9条（将来的なオープンソース化）</h3><ol><li>当サークルは、本サービスが十分に安定し、商用利用や安全性に支障がないと判断した場合、将来的にソースコードを公開し、オープンソースとして提供する可能性があります。</li><li>オープンソース化後は、当該ソースコードについては公開時に定めるオープンソースライセンスが適用され、本規約の第2条第1項の禁止事項は、当該ライセンスに矛盾しない範囲で適用されます。</li></ol><h2 id="プライバシーポリシー" tabindex="-1"><a class="header-anchor" href="#プライバシーポリシー" aria-hidden="true">#</a> プライバシーポリシー</h2><p>TikChoco（以下「当サークル」といいます。）は、提供するサービスに関連してユーザーから収集、またはユーザーから直接提供を受けた個人情報について、当サークルの外部送信ポリシーおよび本プライバシーポリシーに従い、適切な取扱いおよび保護に努めます。<br> ユーザーは、本プライバシーポリシーをよくお読みいただき、ご自身の個人情報およびその取扱いに関する当サークルの方針をご理解ください。</p><hr><h3 id="_1-収集する個人情報" tabindex="-1"><a class="header-anchor" href="#_1-収集する個人情報" aria-hidden="true">#</a> 1．収集する個人情報</h3><p>当サークルは、ユーザーがゲームを利用する際に、以下の情報を自動的に取得します。</p><ul><li>ゲーム内での入力内容および行動に関する情報</li><li>ゲーム内で行った設定内容</li><li>プレイの具体的内容（達成状況、進行度など）</li><li>プレイ日時や総プレイ時間</li><li>クラッシュなどのエラー情報</li><li>IPアドレス、端末の機種・OS・ブラウザ情報、その他デバイス識別情報</li></ul><hr><h3 id="_2-個人情報の利用目的" tabindex="-1"><a class="header-anchor" href="#_2-個人情報の利用目的" aria-hidden="true">#</a> 2．個人情報の利用目的</h3><p>当サークルは、前項で取得した個人情報を以下の目的で利用します。</p><ul><li>サービスの適正な運営および公平性の確保のため、不正行為や契約違反行為を検知・防止すること</li><li>新機能開発やサービス改善を目的とした利用状況の分析・把握</li><li>お問い合わせや技術サポート対応のための連絡</li></ul><hr><h3 id="_3-個人情報の共同利用" tabindex="-1"><a class="header-anchor" href="#_3-個人情報の共同利用" aria-hidden="true">#</a> 3．個人情報の共同利用</h3><p>当サークルは、個人情報を第三者と共同利用する場合には、その利用目的や範囲等を事前にユーザーに通知します。</p><hr><h3 id="_4-保管期間" tabindex="-1"><a class="header-anchor" href="#_4-保管期間" aria-hidden="true">#</a> 4．保管期間</h3><p>当サークルは、取得した個人情報を、利用目的の達成に必要な期間に限り保管します。</p><hr><h3 id="_5-個人情報の管理" tabindex="-1"><a class="header-anchor" href="#_5-個人情報の管理" aria-hidden="true">#</a> 5．個人情報の管理</h3><p>当サークルは、ユーザーの個人情報について常に正確かつ最新の状態を保つよう努めます。<br> また、不正アクセスや不適切な利用による漏えい・紛失・破損を防止するため、組織的・人的・物理的・技術的な安全管理措置を講じます。<br> さらに、個人情報の取扱いを外部に委託する場合には、その委託先に対して適切な監督を行います。</p><hr><p>本サービスの利用によって取得した個人情報は、本プライバシーポリシーに従い適切に取扱います。</p>',51),d=[l];function n(t,c){return i(),e("div",null,d)}const s=a(r,[["render",n],["__file","terms_and_privacy.html.vue"]]);export{s as default};
